import React, { Component } from 'react';

import ProgressComponent from './ProgressComponent'

class ProfileSkills extends Component {
  render() {
    return (
      <div>
        <div className="row">
         <div className="col-md-12">
            <div className="section-title">
               <h2>SKILLS</h2>
               <hr className="hr1"/>
            </div>
         </div>
      </div>
      <div className="row">
         <div className="col-md-12">
            <ProgressComponent />
         </div>
      </div>
    </div>
    );
  }
}

export default ProfileSkills;
